(2, 'Is USPS Issuing No New Christmas Stamps in 2021?', 'Nur Ibrahim', 'We recently received a claim that the U.S. Postal Service is not issuing new Christmas stamps in 2021, ahead of the holidays, but that they do have stamps for Eid, Diwali, Hanukkah, and Kwanzaa.\r\n', 'https://www.snopes.com/fact-check/usps-christmas-stamps-2021/?collection-id=383373', 0, , 'https://about.usps.com/newsroom/national-releases/2021/0907ma-new-stamps-celebrate-the-holidays-with-a-visit-from-st-nick.htm', 'New Stamps Celebrate the Holidays With a Visit From St. Nick', 'Kringle Place', '2021-09-07', 'https://www.snopes.com/tachyon/2021/11/Copy-of-Rating-Overlay-FEATURED-IMG-25-4.jpeg?resize=865,452&quality=65');
