(3, 'Does the Vatican Have Darth Vader in Its Nativity Scene?', 'Bethania Palma', 'Every year, the Vatican puts up a different Nativity display, oftentimes drawing from various Italian towns. This year, the display comes from Castelli, a community in the Abruzzo region.\r\n', 'https://www.snopes.com/fact-check/vatican-nativity/?collection-id=383373', 0, , 'https://www.vaticannews.va/en/vatican-city/news/2020-12/nativity-scene-ceramic-sculptures-st-peters-square-2020.html', 'Behind the Vatican\'s Christmas crib', 'Francesca Merlo', '2020-12-18', 'https://www.snopes.com/tachyon/2020/12/GettyImages-1230069966.jpg?resize=865,452&quality=65');
