(5, 'Did Christmas Presents Never Arrive Late Under Trump?', 'Dan Evon', 'Christmas presents never arrived late during former President Donald Trump\'s presidency. \"What if Christmas, he thought, doesn\'t come from a store. What if Christmas, perhaps, means a little bit more.', 'https://www.snopes.com/fact-check/christmas-presents-never-late-trump/?collection-id=383373', 0, , 'https://www.foxnews.com/us/why-millions-of-christmas-packages-will-be-late-this-year', 'Why millions of Christmas packages will be late this year', 'Jim Jordan', '2020-12-22', 'https://www.snopes.com/tachyon/2021/10/trump-christmas-1.jpg?resize=865,452&quality=65');
