(7, 'Did a ‘Stanford/NIH’ Study Conclude Masks Don’t Work?', 'Alex Kasprak', 'A \"Stanford/NIH\" study concluded that face masks worn to prevent COVID-19 transmission do not work. The paper was published by an exercise physiologist with no academic connection to Stanford Universi', 'https://www.snopes.com/fact-check/stanford-nih-mask-study/?collection-id=341377', 0, , 'https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7680614/', 'Facemasks in the COVID-19 era: A health hypothesis', 'Baruch Vainshelboim', '2020-11-22', 'https://www.snopes.com/tachyon/2021/04/GettyImages-1232325470-e1619019374514.jpg?resize=865,452&quality=65');
