(32, 'Was Trump Carrying a Concealed Oxygen Concentrator When He Boarded Marine One?', 'David Mikkelson', 'U.S. President Donald Trump was carrying a concealed oxygen cylinder or concentrator when he boarded Marine One for a trip to Walter Reed Medical Center after testing positive for COVID-19.', 'https://www.snopes.com/fact-check/trump-carrying-oxygen-concentrator/?collection-id=271519', 0, , 'https://www.npr.org/sections/latest-updates-trump-covid-19-results/2020/10/03/919898777/timeline-what-we-know-of-president-trumps-covid-19-diagnosis', 'Timeline: What We Know Of President Trump\'s COVID-19 Diagnosis, Treatment', 'SAM GRINGLAS', '2020-10-05', 'https://www.snopes.com/tachyon/2020/10/trump_oxygen_feature.jpg?resize=865,452&quality=65');
