(33, 'Was Trump ‘Campaign Ad’ Banned by YouTube and Facebook?', 'Bethania Palma', 'A video described as a \"campaign ad\" promoting U.S. President Donald Trump\'s 2020 reelection campaign was banned by Facebook and YouTube.', 'https://www.snopes.com/fact-check/trump-ad-banned-facebook/?collection-id=271519', 0, , 'https://apnews.com/article/ap-fact-check-donald-trump-ap-top-news-politics-technology-d5610d43d0eedb7caea882814b1659bb', 'Facebook removes Trump ads with symbols once used by Nazis', 'ERIC TUCKER', '2020-01-18', 'https://www.snopes.com/tachyon/2020/08/Featured-Image-Templates71.png?resize=865,452&quality=65');
