(35, 'Did Trump Say People Who Didn’t Attend His Rally Should Be Arrested?', 'David Mikkelson', 'U.S. President Donald Trump tweeted that, \"Anyone who ordered a ticket to my rally and didn\'t attend should be arrested and face very powerful charges.\"', 'https://www.snopes.com/fact-check/trump-rally-arrested-tweet/?collection-id=271519', 0, , 'https://www.nytimes.com/2020/06/21/style/tiktok-trump-rally-tulsa.html', 'TikTok Teens and K-Pop Stans Say They Sank Trump Rally', 'NYT', '2020-07-21', 'https://www.snopes.com/tachyon/2020/06/GettyImages-1221533227-scaled-e1592844665426.jpg?resize=865,452&quality=65');
