(36, 'Was Donald Trump Born in Pakistan?', 'Dan Evon', 'Donald Trump was born \'Dawood Ibrahim Khan\' in Pakistan.. A spoof conspiracy theory holds that Donald Trump was born in the country of Pakistan and not in the United States.', 'https://www.snopes.com/fact-check/donald-trump-was-born-in-pakistan/?collection-id=271519', 0, , 'https://www.mediaite.com/tv/bill-maher-compares-donald-trump-to-an-orangutan-on-leno-ill-donate-5-million-if-he-proves-otherwise/', 'Yahoo News exclusive: Trump releases birth certificate to Bill Maher, demands $5M', 'Yahoo', '2020-10-06', 'https://www.snopes.com/tachyon/2016/11/trump-pic.jpg?resize=865,452&quality=65'),
(37, 'Did ‘Antifa’ Recruit Protesters on Craigslist in Nebraska?', 'Alex Kasprak', '“Antifa” posted an ad on the Lincoln, Nebraska, Craigslist website offering to pay protesters “to cause as much chaos and destruction as possible.”', 'https://www.snopes.com/fact-check/antifa-craigslist-nebraska/?collection-id=252770', 0, NULL, 'https://www.buzzfeednews.com/article/annehelenpetersen/antifa-rumors-george-floyd-protests', 'How The Antifa Fantasy Spread In Small Towns Across The US', 'Anne Helen Petersen', '2020-06-09', 'https://www.snopes.com/tachyon/2020/06/protesters-needed-fi.jpg?resize=865,452&quality=65'),
(38, 'Is This a Pic of a ‘Beheaded’ Christopher Columbus Statue?', 'Dan Evon', 'A photograph shows a statue of Christopher Columbus that was \"beheaded.\"', 'https://www.snopes.com/fact-check/beheaded-columbus-statue/?collection-id=252770', 1, NULL, 'https://www.theguardian.com/us-news/2020/jun/10/christopher-columbus-statue-toppled-virginia', 'Christopher Columbus statues toppled in Virginia and beheaded in Boston', 'Millman, Oliver', '2020-06-10', 'https://www.snopes.com/tachyon/2020/06/Copy-of-Featured-Image-Backgrounds-5.jpg?resize=865,452&quality=65'),
(39, 'Did Obama Foundation Share Pic of George Floyd 9 Days Before He Died?', 'Nur Ibrahim', 'The Obama Foundation mysteriously tweeted an image of a protest sign with George Floyd\'s face on it on May 16 and 17, 2020, more than a week before his death.', 'https://www.snopes.com/fact-check/obama-foundation-floyd-death/?collection-id=252770', 0, NULL, 'https://www.bbc.com/news/world-us-canada-52969905', 'George Floyd death: Why US protests are so powerful this time', 'Helier Cheung', '2020-06-08', 'https://www.snopes.com/tachyon/2020/06/floyd-obama.png?resize=865,452&quality=65'),
(40, 'UPDATED: Is It True That No One Has Died with Omicron Variant?', 'Jessica Lee', 'As of early December 2021, no one worldwide who tested positive for the omicron variant of the coronavirus had died.', 'https://www.snopes.com/fact-check/omicron-deaths/', 0, NULL, 'https://www.bbc.com/news/uk-59639007', 'Covid: First UK death recorded with Omicron varian', 'Becky Morton ', '2021-12-15', 'https://www.snopes.com/tachyon/2021/12/GettyImages-1356237801-1-scaled.jpg?resize=865,452&quality=65'),
(41, 'Did Biden Read ‘End of Message’ During Bob Dole Tribute?', 'Dan MacGuill', 'In a speech paying tribute to Bob Dole, in December 2021, President Joe Biden read aloud \"End of message.\"', 'https://www.snopes.com/fact-check/biden-bob-dole-end-of-message/', 1, NULL, 'https://www.washingtonpost.com/opinions/2021/12/06/bob-dole-op-ed-what-america-needs/', 'America Needs Unity to Rediscover Its Greatness', 'Bob Dole', '2021-12-10', 'https://www.snopes.com/tachyon/2021/12/Screenshot-2021-12-10-at-16.18.40.png?resize=865,452&quality=65'),
(42, 'Does Video Show a Child Handing Biden a Vial of Blood?', 'Dan Evon', 'A video shows a child handing U.S. President Joe Biden a vial of blood.', 'https://www.snopes.com/fact-check/biden-given-vial-of-childs-blood/', 0, NULL, 'https://www.wvxu.org/politics/2021-07-21/analysis-biden-takes-on-everything-from-covid-to-brent-spence-bridge-during-cincinnati-town-hall', 'Analysis: Biden Takes On Everything From COVID To Brent Spence Bridge During Cincinnati Town Hall', 'Howard Wilkinson', '2021-07-21', 'https://www.snopes.com/tachyon/2021/12/GettyImages-1234099047-joe-biden.jpg?resize=865,452&quality=65'),
