(49, 'Was 2020 a ‘Typical Year’ for US Deaths Despite COVID-19?', 'Jessica Lee', 'A meme accurately reports that the U.S. recorded roughly 2.9 million deaths in 2020 — almost the same total as previous years — despite COVID-19.', 'https://www.snopes.com/fact-check/typical-year-covid-deaths/', 0, NULL, 'https://apnews.com/article/us-coronavirus-deaths-top-3-million-e2bc856b6ec45563b84ee2e87ae8d5e7', 'US deaths in 2020 top 3 million, by far most ever counted', 'MIKE STOBBE', '2020-12-22', 'https://www.snopes.com/tachyon/2021/01/GettyImages-1229935876.jpg?resize=865,452&quality=65'),
