(51, 'No, Fauci Did Not Say COVID Vaccines Are ‘Making People Worse’', 'Dan MacGuill', 'Anthony Fauci said COVID-19 vaccines were, or might be, making people more likely to be infected, or more ill from the disease.', 'https://www.snopes.com/fact-check/fauci-covid-vaccine-worse/', 0, NULL, 'https://web.archive.org/web/20211214162750/https://apnews.com/article/pfizer-vaccine-effective-early-data-4f4ae2e3bad122d17742be22a2240ae8', 'Pfizer says COVID-19 vaccine is looking 90% effective', 'LAURAN NEERGAARD', '2020-11-09', 'https://www.snopes.com/tachyon/2021/12/GettyImages-1223642719.jpg?resize=865,452&quality=65'),
(52, 'Did Man Text ‘Amazon Won’t Let Us Leave’ Just Before Warehouse Collapse?', 'Dan Evon', 'An image shows a text message reading \"Amazon won\'t let us leave\" that was sent by Larry Virden shortly before he died when a tornado hit a warehouse.', 'https://www.snopes.com/fact-check/amazon-warehouse-collapse/', 1, NULL, 'https://nypost.com/2021/12/12/amazon-worker-texted-girlfriend-he-wasnt-allowed-to-leave-warehouse/', 'Amazon worker who died in warehouse collapse wasn’t allowed to leave, girlfriend says', 'Patrick Reilly', '2021-12-12', 'https://www.snopes.com/tachyon/2021/12/GettyImages-1237165927.jpg?resize=865,452&quality=65'),
