(54, 'Did George the Dog Give His Life to Save 5 Kids from 2 Pit Bulls?', 'Jordan Liles', 'A small dog named George gave his life to save five children from two pit bulls.', 'https://www.snopes.com/fact-check/george-tiny-dog/', 1, NULL, 'https://www.newspapers.com/image/116117833/?terms=george%20jack%20russell%20zealand&match=1', 'Bravery Medals for Terrier Who Died Saving Kids from Pit Bulls.', 'Democrat and Associated Press', '2011-12-20', 'https://www.snopes.com/tachyon/2021/12/george-tiny-dog.jpg?resize=865,452&quality=65'),
(55, 'Long-Lost Wedding Ring Found Around Carrot', 'Stephanie Larsen', 'A Swedish woman found a long-lost wedding ring in her carrot garden.', 'https://www.snopes.com/fact-check/long-lost-wedding-ring-found-around-carrot/?collection-id=214203', 1, NULL, 'https://www.nydailynews.com/news/world/swedish-couple-find-long-lost-wedding-ring-carrot-garden-article-1.1000639', 'Swedish couple finds long-lost wedding ring on carrot in their garden', 'DAVID BOROFF', '2012-01-04', 'https://www.snopes.com/tachyon/2016/11/Screen-Shot-2016-11-25-at-4.09.19-PM-e1480119411702.png?resize=733,412&quality=65'),
(56, 'Did the Internet Go Dark in D.C. During White House Protests?', 'Jessica Lee', 'Internet and cell service for people protesting police brutality in Washington, D.C., turned off for a temporary \"blackout\" on June 1.', 'https://www.snopes.com/fact-check/washington-dc-blackout/?collection-id=252770', 0, NULL, 'https://www.motherjones.com/politics/2020/06/dcblackout-hoax/', 'Inside the Bizarre Misinformation Campaign About a Hoax Blackout In DC', 'Ali Breland', '2020-06-01', 'https://www.snopes.com/tachyon/2017/01/white_house_tw.jpg?resize=733,412&quality=65'),
(57, 'Did Derek Chauvin Commit Suicide in Prison?', 'David Mikkelson', 'Minneapolis police officer Derek Chauvin committed suicide in his prison cell.', 'https://www.snopes.com/fact-check/derek-chauvin-suicide/?collection-id=252770', 0, NULL, 'https://www.politifact.com/factchecks/2020/jun/01/blog-posting/ex-minneapolis-police-officer-derek-chauvin-did-no/', 'Minneapolis Police Officer Who Killed George Floyd, Derek Chauvin Commits Suicide in Prison Cell.', 'Samantha Putterman', '2020-05-30', 'https://www.snopes.com/tachyon/2020/05/jail-cell-getty.jpg?resize=733,412&quality=65'),
(58, 'Did Twitter Slap a Warning Label on a Trump Tweet for ‘Glorifying Violence’?', 'Nur Ibrahim', 'Twitter added a warning label to and hid U.S. President Donald Trump\'s tweet about the Minneapolis protests against police brutality, saying it violated the platform\'s rules against \"glorifying violen', 'https://www.snopes.com/fact-check/twitter-warning-trumps-tweet/?collection-id=252770', 1, NULL, 'https://apnews.com/article/donald-trump-us-news-ap-top-news-mn-state-wire-virus-outbreak-9c691b85ff052e723663944a85316776?utm_campaign=SocialFlow&utm_source=Twitter&utm_medium=AP', 'Twitter obscures, warns on Trump tweet ‘glorifying violence’', 'BARBARA ORTUTAY', '2020-05-29', 'https://www.snopes.com/tachyon/2020/05/trump-tweet-thugs2.jpg?resize=733,412&quality=65'),
(59, 'Has Switzerland Approved 3D-Printed Pods for Assisted Suicide?', 'Nur Ibrahim', '3D-printed Sarco capsules for assisted suicides, which can be activated from the inside by the person intending to die, have been approved under Swiss law.', 'https://www.snopes.com/fact-check/switzerland-pods-assisted-suicide/', 0, NULL, 'https://www.swissinfo.ch/eng/sarco-suicide-capsule--passes-legal-review--in-switzerland/46966510', 'Sarco suicide capsule hopes to enter Switzerland', 'Clare O\'Dea', '2021-12-11', 'https://www.snopes.com/tachyon/2021/12/Copy-of-Rating-Overlay-FEATURED-IMG-25-2.jpeg?resize=733,412&quality=65'),
(60, 'Are Photos of John F. Kennedy’s Bloody Shirt Real?', 'Jordan Liles', 'Photographs show former U.S. President John F. Kennedy\'s bloodstained shirt from the day he was assassinated.', 'https://www.snopes.com/fact-check/kennedy-bloody-shirt/', 1, NULL, 'https://www.houstonchronicle.com/news/houston-texas/texas/article/Connally-s-bloodied-shirt-vivid-image-of-JFK-4898763.php', 'Connally’s Bloodied Shirt Vivid Image of JFK Assassination.', 'Houston Chronicle', '2013-10-16', 'https://www.snopes.com/tachyon/2021/12/GettyImages-517330536-scaled-e1638998979905.jpg?resize=733,412&quality=65'),
(61, 'Yes, Heinz Created a ‘Chocolate Orange Mayo’ in the UK', 'Dan MacGuill', 'In December 2021, Heinz produced a Terry\'s Chocolate Orange mayonnaise in the United Kingdom and Ireland.', 'https://www.snopes.com/fact-check/heinz-terrys-chocolate-orange-mayo/', 1, NULL, ' https://www.snopes.com/fact-check/heinz-new-condiment-mayoreo/.', 'Did Heinz Launch a New Condiment Called ‘Mayoreo’?', 'Dan MacGuill', '2021-06-25', 'https://www.snopes.com/tachyon/2021/12/Shot5_Landscape_Heinz-Terrys_104413_V3.jpg?resize=733,412&quality=65'),
(62, 'Did 3 Men Die After Being Trapped 16 Days in Sunken Pearl Harbor Battleship?', 'Madison Dapcevich', 'Three men died entombed 40 feet below the ocean after surviving 16 days in the hull of USS West Virginia following the Dec. 7, 1941, attack on Pearl Harbor', 'https://www.snopes.com/fact-check/16-days-trapped-pearl-harbor-battleship/', 1, NULL, 'https://www.history.navy.mil/our-collections/photography/us-navy-ships/battleships/west-virginia-bb-48.html', 'USS West Virginia (BB-48), 1923-1959', 'Bombardment', '2012-12-25', 'https://www.snopes.com/tachyon/2021/12/west-virginia-.jpeg?resize=733,412&quality=65'),
