(104, 'Is This a Sand-Covered Highway to Dubai During the COVID-19 Pandemic?', 'Dan Evon', 'A photograph shows a vacant, sand-covered highway to Dubai during COVID-19 stay-at-home orders.', 'https://www.snopes.com/fact-check/sandy-highway-to-dubai-covid/?collection-id=244110', 0, NULL, 'https://fstoppers.com/aerial/discovering-fake-dubai-road-led-nowhere-306165', 'Discovering Fake Dubai: A Road That Led to Nowhere', 'Ty Poland', '2018-11-16', 'https://www.snopes.com/tachyon/2020/05/Featured-Image-Templates-7.png?resize=733,412&quality=65'),
(105, 'Did Trump Golf, Hold Rallies After Learning About COVID-19 Threat?', 'Dan Evon', 'U.S. President Donald Trump golfed several times and held a number of rallies after learning about the threat of the coronavirus.', 'https://www.snopes.com/fact-check/trump-golf-rallies-coronavirus/?collection-id=243572', 1, NULL, 'https://www.foxnews.com/politics/trump-rallies-in-north-charleston-on-eve-of-south-carolina-primary', 'Trump at South Carolina rally accuses Dems of ‘politicizing’ coronavirus, says ‘we are totally prepared’', 'Alex Pappas', '2020-02-28', 'https://www.snopes.com/tachyon/2020/04/GettyImages-1209355973-e1585767915544.jpg?resize=733,412&quality=65'),
(106, 'Alex Pappas', 'David Mikkelson', 'The U.S. facilitated the sending of nearly 17.8 tons of donated medical supplies to China to combat the spread of the novel coronavirus in early 2020.', 'https://www.snopes.com/fact-check/us-tons-ppe-china/?collection-id=243572', 1, NULL, 'https://www.cnn.com/2020/03/29/opinions/coronavirus-personal-protective-equipment-obeidallah/index.html', 'Trump administration sent protective medical gear to China while he minimized the virus threat to US', 'Dean Obeidallah\r\n\r\n', '2020-05-30', 'https://www.snopes.com/tachyon/2020/03/getty_china_masks.jpg?resize=733,412&quality=65'),
(107, 'Did Trump Tweet in 2009 That He Would ‘Never Let Thousands of Americans Die From a Pandemic’?', 'Dan Evon', 'U.S. President Donald Trump tweeted in November 2009 that \"Obama\'s handling of this whole pandemic has been terrible!\" and that he \"would never let thousands of Americans die from a pandemic while in ', 'https://www.snopes.com/fact-check/2009-trump-tweet-pandemic/?collection-id=243572', 0, NULL, 'https://www.politico.com/news/2020/03/13/trump-coronavirus-testing-128971', '\'I don\'t take responsibility at all\': Trump deflects blame for coronavirus testing fumble', 'Oprysco, Caitlin', '2020-03-13', 'https://www.snopes.com/tachyon/2018/05/donald_trump.jpg?resize=733,412&quality=65'),
(108, 'Did Trump Say ‘Hundreds’ of Governors Are Calling Him Amid COVID-19 Pandemic?', 'Jessica Lee', 'U.S. President Donald Trump said \"hundreds\" of governors are calling him amid the COVID-19 coronavirus pandemic.', 'https://www.snopes.com/fact-check/trump-governors-covid-19/?collection-id=243572', 0, NULL, 'https://trumpwhitehouse.archives.gov/briefings-statements/remarks-president-trump-vice-president-pence-members-coronavirus-task-force-press-briefing-16/', 'Remarks by President Trump, Vice President Pence, and Members of the Coronavirus Task Force in Press Briefing', 'James S. Brady', '2020-04-01', 'https://www.snopes.com/tachyon/2020/04/trump-white-house.jpg?resize=733,412&quality=65'),
(109, 'Did Trump Blame Obama for ‘Bad’ COVID-19 Tests?', 'Bethania Palma', 'U.S. President Donald Trump implied the Obama administration left behind \"bad,\" \"broken,\" and \"obsolete\" COVID-19 diagnostic tests.', 'https://www.snopes.com/fact-check/trump-blame-obama-covid-tests/?collection-id=243572', 1, NULL, 'https://www.insidernj.com/press-release/remarks-president-trump-meeting-governor-murphy-new-jersey/', 'REMARKS BY PRESIDENT TRUMP IN A MEETING WITH GOVERNOR MURPHY OF NEW JERSEY', 'Oval Office', '2020-04-30', 'https://www.snopes.com/tachyon/2020/04/GettyImages-1222090523-scaled-e1588290580753.jpg?resize=733,412&quality=65'),
(110, 'Is WWE’s Vince McMahon Advising Trump on the Economy?', 'Bethania Palma', 'U.S. President Donald Trump tapped World Wrestling Entertainment CEO Vince McMahon as an adviser on reopening the U.S. economy.', 'https://www.snopes.com/fact-check/coronavirus-vince-mcmahon/?collection-id=243572', 1, NULL, 'https://archive.md/MVAkn#selection-585.0-592.0', 'Donald Trump names WWE’s Vince McMahon as adviser to restart US economy', 'Alistair McGeorge', '2020-04-15', 'https://www.snopes.com/tachyon/2020/04/GettyImages-117938673-e1587077847975.jpg?resize=733,412&quality=65'),
(111, 'Did Trump Say COVID-19 Deaths Wouldn’t Hurt Anyone as Much as Himself?', 'David Mikkelson', 'When U.S. President Donald Trump was asked what he\'d say to people who lost family members to COVID-19, he replied, \"I would say this didn\'t hurt anyone as much as it hurt me.\"', 'https://www.snopes.com/fact-check/trump-covid-19-deaths-hurt/?collection-id=243572', 0, NULL, 'https://abcnews.go.com/Politics/transcript-abc-news-anchor-david-muir-interviews-president/story?id=70523003', 'TRANSCRIPT: ABC News anchor David Muir interviews President Trump in Arizona', 'ABC News', '2020-05-06', 'https://www.snopes.com/tachyon/2020/05/trump_abc.jpg?resize=733,412&quality=65'),
(112, 'Did ‘Live and Let Die’ Play as Trump Toured Factory Without COVID-19 Mask?', 'Jessica Lee', 'During the COVID-19 coronavirus pandemic, U.S. President Donald Trump visited a manufacturing plant without wearing a face mask as Guns N\' Roses\' rendition of \"Live and Let Die\" played on loudspeakers', 'https://www.snopes.com/fact-check/trump-live-let-die-song-mask/?collection-id=243572', 1, NULL, 'https://www.businessinsider.com/trump-tours-coronavirus-mask-factory-live-and-let-die-soundtrack-2020-5', '\'Live and Let Die\' blasted out as Trump toured a coronavirus mask factory without covering his face', 'Mia Jankowicz', '2020-05-06', 'https://www.snopes.com/tachyon/2020/05/GettyImages-1211906556-scaled-e1588803744883.jpg?resize=733,412&quality=65'),
(113, 'Did Trump Tweet That Obama ‘Had 8 Years to Prepair the Next President for a Pandemic’?', 'David Mikkelson', 'U.S. President Donald Trump tweeted that Barack Obama \"had 8 years to prepair the next president for a pandemic and he failed.\"', 'https://www.snopes.com/fact-check/trump-tweet-obama-8-years/?collection-id=243572', 0, NULL, 'https://www.snopes.com/fact-check/obama-pandemic-playbook/', 'Did the Obama Administration Fail to Prepare a Pandemic ‘Game Plan’?', 'David Mikkelson', '2020-05-13', 'https://www.snopes.com/tachyon/2017/11/realDonaldTrump_twitter_fb.jpg?resize=733,412&quality=65'),
(114, 'Does This Photo Show Trump Wearing a Protective Mask?', 'Dan Evon', 'A photograph shows U.S. President Donald Trump wearing a protective face mask during a visit to a Ford manufacturing plant in spring 2020.', 'https://www.snopes.com/fact-check/trump-face-mask-ford/?collection-id=243572', 1, NULL, 'https://www.nbcnews.com/politics/donald-trump/trump-refuses-wear-mask-front-cameras-during-ford-tour-n1212466', 'Trump Wears Mask with Presidential Seal During Part of Ford Plant Tour.', 'Gregorian, Dareh', '2020-05-20', 'https://www.snopes.com/tachyon/2020/05/Featured-Image-Templates-6.png?resize=733,412&quality=65'),
(115, 'Did Trump Praise China for Its ‘Transparency’ on COVID-19?', 'Bethania Palma', 'U.S. President Donald Trump praised China for its \"transparency\" in handling the coronavirus outbreak, then later criticized the World Health Organization for doing the same.', 'https://www.snopes.com/fact-check/trump-china-transparency/?collection-id=243572', 1, NULL, 'https://www.c-span.org/video/?471195-1/trump-administration-halts-funding-world-health-organization', 'President Trump with Coronavirus Task Force Briefing', 'CSPAN', '2020-04-14', 'https://www.snopes.com/tachyon/2020/04/GettyImages-1209898290-e1586995193865.jpg?resize=733,412&quality=65'),
(116, 'Will Trump’s Name Appear on COVID-19 Stimulus Checks?', 'Dan Evon', 'U.S. President Donald Trump\'s name will appear on COVID-19 stimulus checks.', 'https://www.snopes.com/fact-check/trumps-name-stimulus-checks/?collection-id=243572', 1, NULL, 'https://fivethirtyeight.com/features/more-than-16-million-americans-have-lost-their-jobs-in-the-past-three-weeks/', 'More Than 16 Million Americans Have Lost Their Jobs In The Past Three Weeks', 'Neil Paine', '2020-04-09', 'https://www.snopes.com/tachyon/2017/05/donald_trump_fb.jpg?resize=733,412&quality=65'),
(117, 'Is This a Real Letter from Trump to US Sen. Chuck Schumer?', 'Bethania Palma', 'U.S. President Trump wrote Sen. Chuck Schumer, D-New York, a letter blaming the state\'s medical-supply shortage amid an ongoing pandemic on impeachment proceedings against Trump.', 'https://www.snopes.com/fact-check/trump-letter-schumer/?collection-id=243572', 1, NULL, 'https://www.nytimes.com/2020/02/05/us/politics/impeachment-vote.html', 'Impeachment Trial Updates: Senate Acquits Trump, Ending Historic Trial\r\n', 'Peter Baker', '2020-02-06', 'https://www.snopes.com/tachyon/2017/05/chuck_schumer_fb.jpg?resize=733,412&quality=65');
